import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

const Home = () => <div>Home Page</div>;
const Buy = () => <div>Buy Page</div>;

const App = () => (
  <Router>
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/" element={<Buy />} />
    </Routes>
  </Router>
);

export default App;
